function click() {
  var debugWindow = this.require('designer').debugWindow(),
    config = this.require('storage').get('system-designer-config'),
    message = this.require('message');

  $('#designer-toolbar-item-refresh').tooltip('hide');
  if ($('#designer-dialog').children().length) {
    $('#' + $("#designer-dialog").children()[0].id).removeClass('fade').modal('hide');
  }

  if (config) {
    if (typeof config.debugType !== 'undefined' && config.debugType === 'client') {
      if (config.urlClient) {
        if (debugWindow && !debugWindow.closed) {
          message.success('Searching for a remote system...');
          this.require('channel').$designerSync();
        } else {
          message.success('Opening the remote system...');
          this.require('designer').debugWindow(this.require('designer').open(config.urlClient, 'debug'));
        }
      } else {
        message.warning('No url set. Please set the url in the configuration panel.');
      }
    }
    if (typeof config.debugType !== 'undefined' && config.debugType === 'server') {
      if (config.urlServer) {
        message.success('Searching for a server...');
        var self = this;
        $.getJSON(config.urlServer.replace(':8888', '') + ':8888/$designerSync', function (system) {
          var Dialog = null,
              dialog = null,
              message = runtime.require('message');

          if (system && system.name) {
            Dialog = self.require('DialogImport');
            dialog = new Dialog({
              'title': 'A system has been found',
              'message': 'Do you wan to import it ?',
              'data': system
            });
            dialog.show();

            dialog.on('ok', function () {
              var sys = null,
                designer = this.require('designer'),
                message = this.require('message');

              if (this.require('factory').system()) {
                this.require('factory').system().destroy();
              }

              sys = this.require('factory').create(this.data());

              // empty log
              this.require('state').logs().forEach(function (item) {
                this.logs().pop();
              }.bind(this.require('state')));

              // hide log
              $('#designer-menu-item-logs-number').hide();
              document.querySelector('#designer-menu-item-logs-number').innerHTML = 0;

              designer.save();

              this.require('state').space(sys.name());
              this.require('spaces').render();
              this.require('workspace').render();

              this.require('router').update();

              this.hide();
              designer.save();

              message.success('Importation of the system is done.');
            });
          } else {
            message.warning('There is no system to import.');
          }
        });
      } else {
        message.warning('No url set. Please set the url in the configuration panel.');
      }
    }
    if (typeof config.debugType === 'undefined') {
      message.warning('No url set. Please set the url in the configuration panel.');
    }
  } else {
    message.warning('No url set. Please set the url in the configuration panel.');
  }
}

