function click() {
  var designer = this.require('designer'),
    message = this.require('message'),
    debugWindow = this.require('designer').debugWindow(),
    runWidow = this.require('designer').runWindow(),
    system = this.require('factory').system(),
    json = {},
    cleanJson = '',
    reg = null;

  $('#designer-toolbar-item-publish').tooltip('hide');
  if ($('#designer-dialog').children().length) {
    $('#' + $("#designer-dialog").children()[0].id).removeClass('fade').modal('hide');
  }

  if (system && system.name() !== 'default') {

    // force save befor running the app
    this.require('designer').save();


    switch(true) {
      // case of extension
      case system.name().indexOf('extension-') !== -1:
        json = this.require('factory').toJSON();

        cleanJson = JSON.stringify(json);
        reg = new RegExp(json._id, 'g');
        cleanJson = cleanJson.replace(reg, 'ext_' + json._id);
        json = JSON.parse(cleanJson);
        runtime.stop(json._id);
        runtime.uninstall(json._id);
        runtime.install(json);
        this.require('menubar').render();
        this.require('toolbar').render();
        message.success('The extension has been installed.');
        break;

      // case of remote debugging
      case debugWindow && !debugWindow.closed:
        this.require('channel').$designerSetSystem(this.require('factory').toJSON());
        // TODO Refresh the page
        //message.success('Running the system in the remote page...');
        break;

      // reload the running page
      case runWidow && !runWidow.closed:
        runWidow.close();
        this.require('designer').runWindow(this.require('designer').open('app/index.html#' + this.require('factory').system().id(), 'app'));
        //message.success('Running the system...');

        /*if (typeof require === 'undefined') {
            runWidow.document.location.reload();
            message.success('Running the system...');
        } else {
            // TODO 
            // to reload when implemented in electron
            message.info('<b>info</b>: to run again the system, click the widow where your system is running and go to the menu \'View > Refresh\’.');
        }*/
        break;

      // we load for the first time the page
      default:
        this.require('designer').runWindow(this.require('designer').open('app/index.html#' + this.require('factory').system().id(), 'app'));
        //message.success('Running the system...');
        break;
    }
  } else {
    message.warning('There is no system to run.');
  }
}

