function init(conf) { 
  var that = this;

  $('html')
    .on('dragenter dragover', false)
    .on('drop', function (e) {
      e.stopPropagation();
      e.preventDefault();
      var files = e.originalEvent.dataTransfer.files;
      var reader = new FileReader();
      var json = '';
      reader.onload = function (event) {
        json += event.target.result;
      };
      reader.onloadend = function () {
        try {
          var sys = JSON.parse(json);

          if (
            typeof sys._id !== 'undefined' &&
            typeof sys.name !== 'undefined' &&
            typeof sys.description !== 'undefined' &&
            typeof sys.version !== 'undefined' &&
            typeof sys.schemas !== 'undefined'
            ) {

            var DialogDropFile = that.require('DialogDropFile');

            if (!that.require('factory').system()) {
              DialogDropFile = new DialogDropFile({
                'title': 'A system has been found',
                'message': 'You can import the system.'
              });
            } else {
              DialogDropFile = new DialogDropFile({
                'title': 'A system has been found',
                'message': 'You can import the system or compose it with the current system.'
              });
            }

            DialogDropFile.data(sys);
            DialogDropFile.show();
          } else {
            that.require('message').warning('The file that you have dropped is not a valid system.');
          }
        } catch(e) {
          that.require('message').warning('The file that you have dropped is not a valid system.');
        }
      };
      if (files[0]) {
        reader.readAsText(files[0], 'UTF-8');
      }
    });
}

