  // system
  System = this.require('System');
  var systems = this.require('storage').get('system-designer-systems');

  // case of url
  switch (true) {
    case window.location.href.split('#').length > 1 && window.location.href.split('#')[1].length > 0:
      systemId = window.location.href.split('#')[1];
      if (this.require('storage').get(systemId)) {
        this.require('factory').create(this.require('storage').get(systemId));
      }
      break;
    default:
      if (systems && systems.systems && systems.systems.length && typeof systems.systems[0] === 'string' && systems.systems[0].length) {
        systems.systems.sort(function (sysA, sysB) {
          var a = this.require('storage').get(sysA),
            b = this.require('storage').get(sysB),
            result = 0;

          if (a.name > b.name) {
            result = 1;
          }
          if (a.name < b.name) {
            result = -1;
          }
          return result;
        }.bind(this));

        this.require('factory').create(this.require('storage').get(systems.systems[0]));
      }
      break;
  }

  this.welcome();

  this.require('router').start();

  if (typeof document.ontouchstart === 'undefined') {
    // resize event
    $(window).resize(function() {
      jsPlumb.repaintEverything();
