      setTimeout(function() {
        window.scrollTo(0, 0);
        if (typeof jsPlumb !== 'undefined') {
          jsPlumb.repaintEverything();
        }
      }, 100);
    });
  }

  this.require('menubar').render();
  this.require('toolbar').render();
  this.require('spaces').render();

  this.addShorcuts();

  // run messages if any
  this.runMessages(this.require('state').messages());
  this.require('state').messages([]);

  // install PWA
  window.addEventListener('beforeinstallprompt', (e) => {
    var config = runtime.require('storage').get('system-designer-config');
    if (!config) {
      config = {};
    }
    if (typeof config.pwaInstalled === 'undefined' && config.welcomeScreen === false) {
