function start() { 
  var that = this;

  window.onhashchange = function (e) {
    var arr = window.location.href.split('#'),
      system = '',
      collection = 'systems',
      component = '',
      i = 0,
      length = 0,
      item = null,
      domItems = null,
      System = that.require('System'),
      systems = that.require('storage').get('system-designer-systems');

    if (arr.length > 1) {
      system = arr[1];
      system = system.split('?')[0];
    }

    if (arr.length > 2) {
      collection = arr[2];
      collection = collection.split('?')[0];
    }

    if (arr.length > 3) {
      component = arr[3];
      component = component.split('?')[0];
    }

    if (arr.length > 4) {
      that.require('state').component(arr[4].split('?')[0]);
    } else {
      that.require('state').component('');
    }

    if (arr.length > 1 && system) {
      that.require('factory').create(that.require('storage').get(system));
    } else {
      if (systems && systems.systems && systems.systems.length) {
        that.require('factory').create(that.require('storage').get(systems.systems[0]));
      }
    }

    that.require('state').space(decodeURIComponent(component));
    that.require('state').menu(decodeURIComponent(collection));

    // focus
    domItems = document.getElementById('designer-menubar-items');
    length = that.require('menubar').items().length;
    for (i = 0; i < length; i++) {
      item = domItems.children[i];
      $(item).removeClass('active');
    }
    for (i = 0; i < length; i++) {
      if (that.require('menubar').items(i).name() === collection) {
        item = domItems.children[i];
        $(item).addClass('active');
      }
    }

    that.update();
  };	
}

